import React, { Component } from 'react'
import styled from 'styled-components'
import { properties, fSize, fWeight } from '../../conf/properties'
import TextBox from '../TextBox/TextBox'
import bgimage from '../../assets/images/25.jpg'
import nlogo from '../../assets/images/nlogo.png'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faListAlt } from "@fortawesome/free-regular-svg-icons"
import { faBell } from "@fortawesome/free-regular-svg-icons"


const MainWrapper = styled.div`
  height : 54px;
  background-color : ${properties.white};
  border-bottom : 1px solid rgba(0, 40, 100, 0.12);
  display: flex;
  flex-direction: row;
  justify-content: center;
`
const SubWrapper = styled.div`
  width: 94%;
  /* height: inherit; */
  /* background-color : ${properties.otherBlue}; */
  display: flex;
  flex-direction: row;
  align-content: center;
  @media (max-width: 550px) {
  flex-direction: column;
`
const Menu1W = styled.div`
  width: auto;
  /* background-color : ${properties.littleLightGrey}; */
  display: flex;
  flex-direction: row;
  align-content: center;
  align-items: center;
  padding: 0px 12px;
  border: 0;

}
`
const IconDiv = styled.div`
  font-size: small;
`
const MenuText = styled.div`
  margin-left: 5px;
`
class HeaderDown extends Component {
  render() {
    return (
      <MainWrapper>
        <SubWrapper>
          <Menu1W>
            <IconDiv>
              <FontAwesomeIcon icon={faListAlt} color={properties.lightGrey} />
            </IconDiv>
            <MenuText>
              <TextBox
                ffamily={"light"}
                color={properties.lightGrey}
                fontSize={fSize.medium}>
                Home </TextBox>
            </MenuText>
          </Menu1W>
          <Menu1W>
            <IconDiv>
              <FontAwesomeIcon icon={faListAlt} color={properties.lightGrey} />
            </IconDiv>
            <MenuText>
              <TextBox
                ffamily={"regular"}
                color={properties.lightGrey}
                fontSize={fSize.medium}>
                Attendees </TextBox>
            </MenuText>
          </Menu1W>
          <Menu1W>
            <IconDiv color={properties.blue}>
              <FontAwesomeIcon icon={faListAlt} color={properties.lightGrey} />
            </IconDiv>
            <MenuText>
              <TextBox
                ffamily={"regular"}
                color={properties.lightGrey}
                fontSize={fSize.medium}>
                Speakers </TextBox>
            </MenuText>
          </Menu1W>
          <Menu1W>
            <IconDiv color={properties.blue}>
              <FontAwesomeIcon icon={faListAlt} color={properties.lightGrey} />
            </IconDiv>
            <MenuText>
              <TextBox
                ffamily={"regular"}
                color={properties.lightGrey}
                fontSize={fSize.medium}>
                My Meetings </TextBox>
            </MenuText>
          </Menu1W>
          <Menu1W>
            <IconDiv color={properties.blue}>
              <FontAwesomeIcon icon={faListAlt} color={properties.lightGrey} />
            </IconDiv>
            <MenuText>
              <TextBox
                ffamily={"regular"}
                color={properties.lightGrey}
                fontSize={fSize.medium}>
                Messages </TextBox>
            </MenuText>
          </Menu1W>
        </SubWrapper>
      </MainWrapper >
    )
  }
}


export default HeaderDown
